import { useEffect } from "react";
import AddBtn from "../../Components/AddBtn";
import Pagination from "../../Components/Pagination";
import Search from "../../Components/Search";
import TeamCard from "../../Components/TeamCard";
import { fetchTeamsAsync } from "../../store/getTeamsSlice";
import { useAppDispatch, useAppSelector } from "../../store/hooks";

const TeamCards: React.FC = () => {
  const dispatch = useAppDispatch();
  const teamsRedux = useAppSelector((state) => state.getTeams.fetchResult);
  console.log("teamsRedux: ", teamsRedux);

  useEffect(() => {
    dispatch(fetchTeamsAsync());
  }, []);

  return (
    <>
      <div className="page-content__top">
        <Search />
        <AddBtn />
      </div>
      <div className="cards-wrapper">
        {/* {teams.map(({ id, name, imageUrl, foundationYear }: ITeam) => {
          return (
            <TeamCard
              id={id}
              name={name}
              imageUrl={imageUrl}
              foundationYear={foundationYear}
            />
          );
        })} */}
      </div>
      <div className="page-content__bottom">
        <Pagination />
      </div>
    </>
  );
};

export default TeamCards;
